import s from './usersInfo.module.css'

const UsersInfo = (props)=>{

  let add_user_as_friend = <div></div>
  if (props.type == 'notLoggedUsersProfile'){
    add_user_as_friend = <button>Add User as friend</button>
  }

  return(
    <div className={s.add_info}>
      <div className={s.username}><div>{props.username}</div></div>
      <div className={s.add_friend_button}>{add_user_as_friend}</div>
      <div className={s.watched_films}><button>Watched films</button></div>
      <div className={s.planned_films}><button>Planned films</button></div>
      <div className={s.last_film}><button>Last watched film</button></div>
      <div className={s.read_books}><button>Read books</button></div>
      <div className={s.planned_books}><button>Planned books</button></div>
      <div className={s.last_books}><button>Last read book</button></div>
    </div>
  )
}

export default UsersInfo;
